import React, { useState,useEffect } from 'react';
import './Popular.css'; // Importing CSS styles for the component
import Item from '../Item/Item'; // Importing the Item component

const Popular = () => {

    const[popularProducts,setPopularProducts] = useState([]);

    useEffect(()=>{
        fetch('https://your-own-style-1.onrender.com/popularinwomen')
        .then((response)=>response.json())
        .then((data)=>setPopularProducts(data))
    },[])


    return (
        <div className='popular'>
            <h1>POPULAR IN WOMEN</h1>
            <hr />
            <div className="popular-item">
                {popularProducts.map((item, i) => {
                    return <Item key={i} id={item.id} name={item.name} image={item.image} new_price={item.new_price} old_price={item.old_price} />;
                })}
            </div>
        </div>
    );
};

export default Popular; // Exporting the Popular component for use in other files
